import React from 'react'
import DonutChart from 'react-donut-chart'

function Chart({ label, value }) {
    return (
        <DonutChart
            data={[
                {
                    label: '',
                    value: 1 - value,
                    isEmpty: true
                },
                {
                    label,
                    value,
                    isEmpty: false
                }
            ]}
            styles={{
                '.chart_text': {
                    fontSize: '1.5em',
                    fill: '#fff'
                }
            }}
            height={150}
            legend={false}
            width={150}
            colors={['#1497f2']}
        />
    )
}

export default Chart
